<script>
var deaths=0,active=0,recovered=0; 
var hQ=iQ=1;
$(document).ready(function(){
     
$('.clicker').click(function(){
 
  var userid = $(this).attr('id');
   
  // AJAX request
  $.ajax({
   url: 'Dashboard/loadDistrictModal',
   type: 'post',
   data: {userid: userid},
   success: function(response){ 
     // Add response in Modal body
     console.log(response);
     var obj = JSON.parse(response);
     $('#district').html(userid);
     deaths = parseInt(obj.deceased);
    active = parseInt(obj.confirmed);
     recovered = parseInt(obj.recovered);
     hQ = parseInt(obj.quarantined_home);
     iQ = parseInt(obj.quarantined_government);
    var tQ = hQ+iQ;
    var confirmed = active + deaths + recovered;
     
     $('#total').html(confirmed);
     $('#active').html(active);
     $('#deceased').html(deaths);
     $('#recovered').html(recovered);
$('#hQR').html(obj.quarantined_home);
$('#tQR').html(tQ);
$('#gQR').html(obj.quarantined_government);
     // Display Modal
     $('.emod').modal('show'); 
     var ctx = document.getElementById("myActiveChart"); 
var myChart = new Chart(ctx, { 
  type: 'doughnut', 
  data: { 
    labels: ["Deaths" , "Recovered" ,"Active"], 
    datasets: [ 
      { label: '# of students', 
        data: [deaths,recovered,active], 
        backgroundColor :[
                'rgba(255, 99, 132, 1)', 
                'rgba(54, 162, 235, 1)', 
                'rgba(255, 206, 86, 1)'
], 
  
borderColor: [ 
                'rgba(255, 99, 132, 1)', 
                'rgba(54, 162, 235, 1)', 
                'rgba(255, 206, 86, 1)'
            ]
      } 
    ] 
  }
}); 
var ctx = document.getElementById("mySuspectChart"); 
var myChart = new Chart(ctx, { 
  type: 'doughnut', 
  data: { 
    labels: ["Home Quarantine" , "Instutional Quarantine" ], 
    datasets: [ 
      { label: '# of students', 
        data: [hQ,iQ], 
        backgroundColor :[
                'rgba(255, 99, 132, 1)', 
                'rgba(54, 162, 235, 1)', 
                'rgba(255, 206, 86, 1)'
], 
  
borderColor: [ 
                'rgba(255, 99, 132, 1)', 
                'rgba(54, 162, 235, 1)', 
                'rgba(255, 206, 86, 1)'
            ]
      } 
    ] 
  }
}); 
   }
 });
});
});
  
    </script>
  
